  /**
 * Details about an insurance plan.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/InsurancePlan-definitions.html#InsurancePlan.plan}
 */
  plan: Array<BackboneElement>;
  
  /**
 * Indicates a purpose for which the contact can be reached.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/InsurancePlan-definitions.html#InsurancePlan.contact.pur
 * pose}
 */
  purpose: CodeableConcept;
  
  /**
 * Additional information about the cost, such as information about funding sources
 * (e.g. HSA, HRA, FSA, RRA).
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/InsurancePlan-definitions.html#InsurancePlan.plan.specif
 * icCost.benefit.cost.qualifiers}
 */
