/**
 * VisionPrescription
 * 
 * An authorization for the provision of glasses and/or contact lenses to a
 * patient.
 * 
 * @see {@link http://hl7.org/fhir/R4B/VisionPrescription.html}
 */
export interface VisionPrescription  extends  DomainResource {
  /** Resource Type Name (for serialization) */
  
  readonly resourceType: "VisionPrescription";
  

  
  /**
 * Power adjustment for multifocal lenses measured in dioptres (0.25 units).
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.add}
 */
  add: decimal;
  
  /**
 * Amount of prism to compensate for eye alignment in fractional units.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.prism.amount}
 */
  amount: decimal;
  
  /**
 * Adjustment for astigmatism measured in integer degrees.
 * 
 * The limits are +180 and -180 degrees.
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.axis}
 */
  axis: integer;
  
  /**
 * Back curvature measured in millimetres.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.backCurve}
 */
  backCurve: decimal;
  
  /**
 * The relative base, or reference lens edge, for the prism.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.prism.base}
 */
  base: code;
  
  /**
 * Brand recommendations or restrictions.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.brand}
 */
  brand: string;
  
  /**
 * Special color or pattern.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.color}
 */
  color: string;
  
  /**
 * The date this resource was created.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.c
 * reated}
 */
  created: dateTime;
  
  /**
 * Power adjustment for astigmatism measured in dioptres (0.25 units).
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.cylinder}
 */
  cylinder: decimal;
  
  /**
 * The date (and perhaps time) when the prescription was written.
 * 
 * Jurisdictions determine the valid lifetime of a prescription. Typically vision
 * prescriptions are valid for two years from the date written.
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.d
 * ateWritten}
 */
  dateWritten: dateTime;
  
  /**
 * Contact lens diameter measured in millimetres.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.diameter}
 */
  diameter: decimal;
  
  /**
 * The recommended maximum wear period for the lens.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.duration}
 */
  duration: Quantity;
  
  /**
 * A reference to a resource that identifies the particular occurrence of contact
 * between patient and health care provider during which the prescription was
 * issued.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.e
 * ncounter}
 */
  encounter: Reference;
  
  /**
 * The eye for which the lens specification applies.
 * 
 * May also appear as OD (oculus dexter) for the right eye and OS (oculus siniter)
 * for the left eye.
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.eye}
 */
  eye: code;
  
  /**
 * A unique identifier assigned to this vision prescription.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.i
 * dentifier}
 */
  identifier: Array<Identifier>;
  
  /**
 * Contain the details of  the individual lens specifications and serves as the
 * authorization for the fullfillment by certified professionals.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification}
 */
  lensSpecification: Array<BackboneElement>;
  
  /**
 * Notes for special requirements such as coatings and lens materials.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.note}
 */
  note: Array<Annotation>;
  
  /**
 * A resource reference to the person to whom the vision prescription applies.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.p
 * atient}
 */
  patient: Reference;
  
  /**
 * Contact lens power measured in dioptres (0.25 units).
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.power}
 */
  power: decimal;
  
  /**
 * The healthcare professional responsible for authorizing the prescription.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.p
 * rescriber}
 */
  prescriber: Reference;
  
  /**
 * Allows for adjustment on two axis.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.prism}
 */
  prism: Array<BackboneElement>;
  
  /**
 * Identifies the type of vision correction product which is required for the
 * patient.
 * 
 * 
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.product}
 */
  product: CodeableConcept;
  
  /**
 * Lens power measured in dioptres (0.25 units).
 * 
 * The value is negative for near-sighted and positive for far sighted.
 * Often insurance will not cover a lens with power between +75 and -75.
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.l
 * ensSpecification.sphere}
 */
  sphere: decimal;
  
  /**
 * The status of the resource instance.
 * 
 * This element is labeled as a modifier because the status contains codes that
 * mark the resource as not currently valid.
 * 
 * @see {@link
 * http://hl7.org/fhir/R4B/VisionPrescription-definitions.html#VisionPrescription.s
 * tatus}
 */
  status: code;
  
}


